const fs = require("fs");
const 輸出檔名 = '資料/寶雅.tsv'
建立輸出檔案(輸出檔名)

Object.values(取得門市資料()).forEach(x => {
    Object.values(x.districts).forEach(d => {
        d.stores.forEach(s => {
            const lng = parseFloat(s.store_longitude).toFixed(6)
            const lat = parseFloat(s.store_latitude).toFixed(6)
            const line = `寶雅\t${decodeURI(s.store_name)}\t${decodeURI(s.store_address)}\t${decodeURI(x.name)}\t${decodeURI(d.name)}\t${lng}\t${lat}`
            輸出結果(輸出檔名, line)
        })
    })
})

//--- END ---

function 建立輸出檔案(檔案名稱) {
    const 欄位名稱 = '類別\t名稱\t地址\t縣市\t鄉鎮\t經度\t緯度'
    fs.writeFileSync(檔案名稱, '', {flag: 'w+'})
    fs.writeFileSync(檔案名稱, 欄位名稱 + '\r\n', {flag: 'a'})
}

function 輸出結果(檔案名稱, 結果) {
    console.log(結果)
    fs.writeFileSync(輸出檔名, 結果 + '\r\n', {flag: 'a'})
}

